  false,\n\t\"url\": null,\n\t\"notes\": \"Final report on a project at Madison Wetland
  Management District to measure discharged tile drain pollutants (nutrients, pesticides,
  salts, metals and metalloids) in Waterfowl Production Areas (WPA) water and sediments
  and compare results with biological assessments for aquatic vegetation, invertebrates
  and amphibians to determine whether water quality impairments need to be addressed.
  Based on study results, the district will recommend direct and indirect management
  actions to improve water quality in support of trust natural resources.\",\n\t\"license_title\":
